import {useNavigate} from 'react-router-dom'

function Menu(props){
  let navigate = useNavigate();

  if(props.loginState == false){
    return (
      <>
        <span className="siteName">Mandalart</span>
        <div className="visitorMenu">
          <span onClick={()=>{navigate('/login')}}>로그인</span>
          <span>회원가입</span>
        </div>
      </>
    )
  }
  return (
    <>
    <span className="siteName">Mandalart</span>
    <div className="visitorMenu">
      <span>나의 만다라트</span>
      <span>회원명</span>
    </div>
    </>
  )
}

export default Menu;
